import React, { useState, useEffect } from 'react';

function NewCheats() {
  const [cheats, setCheats] = useState([]);

  useEffect(() => {
    fetchCheats();
  }, []);

  const fetchCheats = async () => {
    try {
      const response = await fetch('api/viewcheats');
      if (!response.ok) {
        throw new Error('Failed to fetch cheats');
      }
      const data = await response.json();
      setCheats(data['All Cheats']);
    } catch (error) {
      console.error('Error fetching cheats:', error);
    }
  };

  return (
    <div>
        {cheats.map((cheat) => (
          <li key={cheat.id}>
            <p>Hack: {cheat.hack}</p>
            <p>Username: {cheat.username}</p>
            <p>Likes: {cheat.likes}</p>
            <p>Dislikes: {cheat.dislikes}</p>
            <p>Reports: {cheat.reports}</p>
          </li>
        ))}

    </div>
  );
}

export default NewCheats;
